import React,{Component} from "react";
import{Div0,Div1,Div1Center,Div2,Div2Detail}from'./style';
import DataDraw from "../main/DataDraw";
const DataDraw3 = () => {
    return(
            <Div0>
                <Div1 className="left">
                    <DataDraw/>
                </Div1>
                <Div1 className="right">
                </Div1>
            </Div0>

    )
}
export default DataDraw3;
